  false,\n\t\"url\": null,\n\t\"notes\": \"The Rocky Mountain Arsenal National Wildlife
  Refuge Fish and Wildlife Management Plan was prepared to guide U.S. Fish and Wildlife
  Service (Service) study and work activities for fiscal year 1994. Proposed activities
  included in this FY 1994 plan are divided into the following five specific Service
  tasks as defined by the Cooperative Agreement for Conservation and Management of
  Fish and Wildlife Resources at Rocky Mountain Arsenal: Task 1 Fish and Wildlife
  Health Status Monitoring; Task 2 Fish and Wildlife Habitat Mitigation, Enhancement,
  and Protection; Task 3 Activities Coordination Program; Task 4 Planning/Public Participation;
  and Task 5 Engineering and Administrative Support. Refuge background, resources
  of concern, and habitat and wildlife management goals and objectives are discussed.
  Management strategies and prescriptions then identify how and the specific means
  by which management and monitoring strategies will be implemented.\",\n\t\"license_title\":
